const NotFound = () => (
    <div>
      <h1 className="Notfound">Niestety zabładziłeś, na pewno tego szukales?</h1>
      <p>Upewnij się, że wpisałeś poprawny adres URL </p>
      <img
          src="https://img.freepik.com/premium-zdjecie/usmiechniety-murzyn-z-bialym-recznikiem-pokazuje-ok-gest_99043-2541.jpg"
          alt="Instagram"
          style={{ width: "3", height: "30px" }}
        />
    </div>
  );
  
  export default NotFound;
